import Document, { Html, Head, Main, NextScript } from 'next/document';

export default class extends Document {
  render () {
    return (
      <Html>
        <Head />
        <body>
          <Main />
          {/* here we will mount our video*/}
          {/* <div id='video' /> */}
          <NextScript />
        </body>
      </Html>
    )
  }
}
